const RegistrationWithCheckBox = ({ inputWithRadioButton,onSelectGender, ...props }) => {
  debugger;
  return (
    <div>
      <div>
        {Object.keys(inputWithRadioButton).map((lable, index) => {
          return (
            <div>
              <label>{lable}</label>
              {inputWithRadioButton.gender.map(value => {
                return (
                  <div>
                    <lable>{value}</lable>
                    <input type="radio" name = {lable} onChange = {onSelectGender}/>

                  </div>
                );
              })}
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default RegistrationWithCheckBox;
